import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';


function App() {
  return (
    <div className="App">
     <h1>InvoChat</h1>
     <BrowserRouter>
        <Switch>
          <Route path="/signup">
            <p>This is the route</p>
          </Route>
        </Switch>
      </BrowserRouter>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
